import React, { useState } from 'react';

export default function SignUp() {
  const [parentFirstName, setParentFirstName] = useState('');
  const [parentLastName, setParentLastName] = useState('');
  const [parentEmail, setParentEmail] = useState('');
  const [parentPhoneNumber, setParentPhoneNumber] = useState('');
  const [kids, setKids] = useState([{ name: '', lastName: '', age: '' }]);
  const [numKids, setNumKids] = useState(1);

  const handleAddKid = () => {
    setKids([...kids, { name: '', lastName: '', age: '' }]);
    setNumKids(numKids + 1);
  };

  const handleKidChange = (event, index) => {
    const { name, value } = event.target;
    const newKids = [...kids];
    newKids[index][name] = value;
    setKids(newKids);
  };

  const handleSubmit = (event) => {
    event.preventDefault();
    const formData = {
      parentFirstName,
      parentLastName,
      parentEmail,
      parentPhoneNumber,
      enfants: kids.map((kid, index) => ({
        prenomEnfant: kid.name,
        nomEnfant: kid.lastName,
        dateNaissance: kid.age,
        index: index
      }))
    };


    // Make a POST request to the server
    fetch('http://localhost:8080/addEnfantPreinscri', {
      method: 'POST',
      headers: {
        'Content-Type': 'application/json',
      },
      body: JSON.stringify(formData),
    })
      .then((response) => {
        if (response.ok) {
          // Handle successful response
          console.log('Form submitted successfully');
          // Clear form fields
          setParentFirstName('');
          setParentLastName('');
          setParentEmail('');
          setParentPhoneNumber('');
          setKids([{ name: '', lastName: '', age: '' }]);
          setNumKids(1);
          // Display success message to user
          alert('Form submitted successfully!');
        } else {
          // Handle error response
          console.error('Error submitting form');
          // Display error message to user
          alert('Error submitting form. Please try again.');
        }
      })
      .catch((error) => {
        // Handle network error
        console.error('Network error:', error);
        // Display error message to user
        alert('Network error. Please try again later.');
      });
  };

  return (
    <div>
      <h1 className='sign-up'>pré-inscrie maintenant!</h1>
      <form onSubmit={handleSubmit}>
        {/* Parent information inputs */}
        <div>
          <label htmlFor="parent-first-name">Prénom du parent:</label>
          <input
            type="text"
            id="parent-first-name"
            value={parentFirstName}
            onChange={(event) => setParentFirstName(event.target.value)}
          />
        </div>
        {/* Other parent information inputs */}
        <div>
          <label htmlFor="parent-last-name">Nom du parent:</label>
          <input
            type="text"
            id="parent-last-name"
            value={parentLastName}
            onChange={(event) => setParentLastName(event.target.value)}
          />
        </div>
        <div>
          <label htmlFor="parent-email">Votre email:</label>
          <input
            type="email"
            id="parent-email"
            value={parentEmail}
            onChange={(event) => setParentEmail(event.target.value)}
          />
        </div>
        <div>
          <label htmlFor="parent-phone">Numéro de téléphone:</label>
          <input
            type="tel"
            id="parent-phone"
            value={parentPhoneNumber}
            onChange={(event) => setParentPhoneNumber(event.target.value)}
          />
        </div>
        {/* Kids information inputs */}
        {kids.map((kid, index) => (
          <div key={index}>
            <label htmlFor={`kid-name-${index}`}>Prénom de l'enfant:</label>
            <input
              type="text"
              id={`kid-name-${index}`}
              name="name"
              value={kid.name}
              onChange={(event) => handleKidChange(event, index)}
            />
            <label htmlFor={`kid-last-name-${index}`}>Nom de l'enfant:</label>
            <input
              type="text"
              id={`kid-last-name-${index}`}
              name="lastName"
              value={kid.lastName}
              onChange={(event) => handleKidChange(event, index)}
            />
            <label htmlFor={`kid-age-${index}`}>Âge de l'enfant:</label>
            <input
              type="number"
              id={`kid-age-${index}`}
              name="age"
              value={kid.age}
              onChange={(event) => handleKidChange(event, index)}
            />
          </div>
        ))}
        <button type="button" onClick={handleAddKid}>
          Ajouter un enfant
        </button>
        <button type="submit">SUIVANT</button>
     </form>
    </div>
  );
}
